import React from 'react';
import Document, { Head, Main, NextScript } from 'next/document';
import { ServerStyleSheet, createGlobalStyle } from 'styled-components';

const GlobalStyle = createGlobalStyle`
  @font-face {
    font-family: 'Pangram';
    src: url('static/fonts/Pangram-Regular.ttf');
    src: url('static/fonts/Pangram-Bold.ttf');
    src: url('static/fonts/Pangram-Black.ttf');
    src: url('static/fonts/Pangram-ExtraLight.ttf');
  }


`;

class MyDocument extends Document {
  static async getInitialProps(ctx) {
    const sheet = new ServerStyleSheet();
    const originalRenderPage = ctx.renderPage;

    try {
      ctx.renderPage = () =>
        originalRenderPage({
          enhanceApp: App => props => sheet.collectStyles(<App {...props} />)
        });

      const initialProps = await Document.getInitialProps(ctx);
      return {
        ...initialProps,
        styles: (
          <>
            {initialProps.styles}
            {sheet.getStyleElement()}
          </>
        )
      };
    } finally {
      sheet.seal();
    }
  }

  render() {
    return (
      <html lang="en">
        <Head>
          <meta charSet="utf-8" />
          <meta name="viewport" content="width=device-width, initial-scale=1"/>
          <link href="https://fonts.googleapis.com/css?family=Chewy&display=swap" rel="stylesheet"></link>
          <style jsx>{`
        *{
          padding: 0;
          margin:0;
        }

        body{
          margin:0;
        }
      `}</style>
        </Head>
        <body>
          <GlobalStyle/>
          <Main />
          <NextScript />
        </body>
      </html>
    );
  }
}

export default MyDocument;
